import {
  shopColumns,
  coachColumns,
  priceConfigColumns
} from './info#table.config'
import { InfoService } from './info.service'
import { AppConfig } from '@/constants/config'
export default {
  bem: {
    b: 'header',
    bb: 'body',
    bAdv: 'page-dashboard-adv'
  },
  name: 'TeamCourseInfo',
  serviceInject() {
    return {
      appConfig: AppConfig,
      infoService: InfoService
    }
  },
  rxState() {
    return {
      teamCourseInfo: this.infoService.teamCourseInfo$
    }
  },
  computed: {
    coachColumns,
    image() {
      return this.teamCourseInfo.image.image_key
    }
  },
  filters: {
    filterTrainAim(val) {
      return val
        .map(item => {
          return item.name
        })
        .join(' / ')
    }
  },
  data() {
    return {
      shopColumns,
      priceConfigColumns
    }
  }
}
